  describe('should not affect values in the params', (): void => {
    const useCases: any[] = [
      {result: 'a=0.1&b=1.5&c=2.6', value: {a: 0.1, b: 1.5, c: 2.6}, message: 'for simple objects'},
      {
        message: 'for nested objects',
        result: 'a=0&b=1&c=2&d.e=3.3&d.f=4.4&d.g.h=5.5',
        value: {a: 0, b: 1, c: 2, d: {e: 3.3, f: 4.4, g: {h: 5.5}}}
      },
      {
        message: 'for nested objects with arrays',
        result: 'a=0&b=1&c=2&d.e=3&d.f[0]=4.4&d.f[1]=5.5&d.f[2]=6.6&d.g.h=7.7',
        value: {a: 0, b: 1, c: 2, d: {e: 3, f: [4.4, 5.5, 6.6], g: {h: 7.7}}}
      },
      {
        message: 'for deeply nested objects with multi level arrays',
        // tslint:disable-next-line:max-line-length
        result: 'a=0.1&b=1.1&c=2.2&d.e=3.3&d.f[0]=4.4&d.f[1]=5.5&d.f[2]=6.6&d.f[3].k=11.11&d.f[3].l=111.111&d.f[3].m=1111.1111&d.f[4][0]=0.01&d.f[4][1]=00.001&d.f[4][2]=000.0001&d.g.h=7.7&d.g.j.ee=2.2&d.g.j.de=22.22&d.g.j.ed=222.222',
        value: {
          a: 0.1,
          b: 1.1,
          c: 2.2,
          d: {
            e: 3.3,
            f: [
              4.4,
              5.5,
              6.6,
              {
                k: 11.11,
                l: 111.111,
                m: 1111.1111
              },
              ['0.01', '00.001', '000.0001']
            ],
            g: {h: 7.7, j: {ee: 2.2, de: 22.22, ed: 222.222}}
          }
        }
      },
      {
        message: 'for simple objects with Arrays',
        value: {a: [0.01, 1.1, 2.2], b: [3.3, 4.4, 5.5], c: [6.6, 7.7, 8.8]},
        result: 'a[0]=0.01&a[1]=1.1&a[2]=2.2&b[0]=3.3&b[1]=4.4&b[2]=5.5&c[0]=6.6&c[1]=7.7&c[2]=8.8'
      }
    ];
    forEach(useCases, (useCase: any): void => {
      it(
        `type ${useCase.message}`,
        // tslint:disable-next-line:max-line-length
        inject([UrlHelper], (helper: UrlHelper): boolean => expect(typeof helper.encodeParams(useCase.value)).toBe(typeof useCase.result))
      );
      it(
        `value ${useCase.message}`,
        // tslint:disable-next-line:max-line-length
        inject([UrlHelper], (helper: UrlHelper): boolean => expect(helper.encodeParams(useCase.value)).toEqual(useCase.result))
      );
    });
  });
